init('{{{WzY2LDIzMyw0NjQsNDc3LCdodHRwOi8vd3d3LmRpZ2l0YWxvZmZpY2Vwcm8uY29tL3Bvd2VycG9pbnQvcG93ZXJwb2ludC10by1odG1sNS1jb252ZXJ0ZXIuaHRtbCdd',[[[0,[["Rationale: Welcome to “Designing an Effective PowerPoint, Part 3: Practical Guides.” The goal of this presentation is to introduce you to the practical tasks involved in creating a PowerPoint project. There are always many methods with which to create PowerPoint presentations, and the ones covered in this document are some of the simplest. ",8]]],[0,[["This guide assumes that the reader is creating a presentation to deliver in front of a group of people. For that reason, it covers creating new slides, transitions, animations, integrating material outside of PowerPoint into a presentation and includes a brief discussion of an alternate way to use PowerPoint. The practical advice this guide offers applies to all versions of PowerPoint, but the nuts and bolts of this guide’s practical information (the organization of menus, for instance) applies most readily to Microsoft Office 2003 for PCs and Microsoft Office 2004 for Macs.",8]]],[0,[["This document is most useful when used in conjunction with “Designing an Effective PowerPoint Parts 1 and 2” (“Before You Start” and “Design Principles,” respectively).",8]]],[0,[["Directions:",8],[" Each slide is activated by a single mouse click, unless otherwise noted in bold at the bottom of each notes page",0]]],[0,[["Writer and Designer: Lars Erik Söderlund",0]]],[0,[["Special Thanks to Robin Williams, whose Non-Designer’s Design Book and Design Workshop were helpful aids in the development of these materials.",0]]],[0,[["Developed with resources courtesy of the Purdue University Writing Lab",0]]],[0,[["Grant funding courtesy of the Multimedia Instructional Development Center at Purdue University",0]]],[0,[["© Copyright Purdue University, 2000, 2006",0]]]],[[0,[["Rationale:  ",8],["This slide defines the term “Interior Content.”  Note that Interior Content does not include your spoken part of the presentation, your hand gestures, or your movement around the room. Those will also be indispensable parts of your presentation and I refer to them as “Exterior Content” (more on that later).",0]]]],[[0,[["Rationale:  The first step in making any PowerPoint is to create a slide (that is, to insert the slide into your presentation). ",8],["In most versions of PowerPoint,  click on “Insert” from the File Menu and then click New Slide. After your new slide appears, you add content by clicking Insert and then some type of content (a picture or a text box, for example).",0]]],[0,[["I have made the instructions on this slide and others purposefully simple as a reminder that the process is essentially a simple one. Even the best presentations are still just slides with content on top of them.",0]]]],[[0,[["Rationale:  ",8],["This slide explains transitions. This next slide will appear with a Transition called “Wipe Right.”",0]]]],[[0,[["Rationale:  ",8],["This slide explains how to create transitions from the Normal View within PowerPoint. Normal View is the default view of PowerPoint, and likely the view you currently have in order to view these Speaker Notes. To create a transition between PowerPoint slides, view the slide you wish to edit (the slide you wish to be introduced with a selected transition) and follow the directions above.",0]]]],[[0,[["Rationale:  ",8],["Transitions can be fun, but must be used carefully. For example, I would not have used Wipe Right on the previous slide transition if I did not feel it necessary to make sure that all viewers knew the definition of transitions. If you are going to include a transition, be sure that it serves a purpose within your presentation.",0]]]],[[0,[["Rationale:  ",8],["Animations are what people often picture in their minds when they think of PowerPoint. Have you ever seen the items of a bulleted list PowerPoint fly across the screen into place, one by one? That is an animation. Text on this page has appeared with an animation called “Fade In.”",0]]]],[[0,[["Rationale: This slide shows you how to create animations. First, click on the slide element (picture, text, graphic) you wish to animate. Then, under the Slide Show Menu, click Pre-Set Animations and select an animation. Or you can have your element(s) appear in a customized way by selecting Custom Animations under the Slide Show Menu.",0]]]],[[0,[["Rationale:  ",8],["The same advice applies for Animations as for Transitions. Make sure that every design decision you make has a reason within the context of your presentation.",0]]]],[[0,[["Rationale:  ",8],["This slide and the next one are examples of bad transitions and animations. Their wild, random effects seem to grab the audience’s attention, but they actually distract from the message that they are trying to convey. See the coverage of Contrast and Repetition in “Designing an Effective PowerPoint Part 2, Design Principles.” ",0]]],[0,[["Note: you must enter Slide Show View mode in order to view the transitions and animations.",0]]]],[[0,[["Rationale: This slide’s transitions are even more distracting. After such exciting and varied transitions, can any content measure up? The audience will quickly lose interest in the message after so much flash in the presentation.",8]]]],[[0,[["Rationale:  This slide and the next are better examples of transition and animation use. They are much less noticeable, and so fit into the flow of the presentation. ",8],["If you feel you must have animation, be sure to make it classy. Try to do as little design as you can so that your message is more effectively framed. There is a reason that “elegant” is a synonym of “minimal.”",0]]]],[],[[0,[["Rationale:  ",8],["For a presentation to be effective, it must include content that outside of PowerPoint.",0]]]],[[0,[["Rationale: When planning the delivery of your presentation, keep in mind ",8],["what will be best expressed by you in your own voice; remember, rarely can even the best PowerPoint take the place of a real, human voice. Similarly, try not to rely too much on a laser pointer; instead use the design of your slides to direct your audience’s attention. ",0]]],[0,[["Remember what Powerpoint can do and what it can't (and keep in mind what you're comfortable doing in PowerPoint and not). If you want to have an audience’s complete, undivided attention, leave time between slides to talk uninterrupted, or even insert a white, blank slide and look your audience in the eye as you speak to them. Further, you can use ”Presenter Tools\" and other facilities in the newer versions of PowerPoint to enhance your presentation. Search your Office software’s Help for assistance on presenter tools, and consult rhetoric and elocution manuals for help in public speaking.",0]]]],[[0,[["Rationale:  This slide defines the traditional corporate PowerPoint look. It is practical to the core, with",8],[" strong, clean lines (such as the left margin), no superfluous elements (extra pictures or colors), and no unusual or weird typefaces. What most people forget, though, is that the \"corporate look\" is not always the most effective, even in corporate presentations. Sometimes an extra picture or an unusual font will add personality to a project, which is good if that's what you are going for. Keeping CARP in mind (a mnemonic for Contrast, Alignment, Repetition, and Proximity, explained in “Designing and Effective PowerPoint, Part 2”) will ensure that your presentation is still appealing.",0]]]],[[0,[["Rationale: There are many alternate methods to the corporate look, and this slide explains one. It uses no template, no repeating background, and no more than six words on each slide. It is extremely image heavy, meaning that it uses arresting pictures or drawings to attract the audience’s attention. There are little or no animations, and generally no transitions between slides. Because of these strictures, presentations formed with this alternate method must rely almost completely on Exterior Content to communicate their messages and even to explain the purpose of each slide.",8]]]],[[0,[["Rationale: This is a slide that would work in the alternate method. It is much more visually stimulating than a PowerPoint slide from a template, and the picture adds an emotional effect when paired with the intentionally minimal words. Such a slide would, of course, benefit from a good speaker discussing the slide’s subject matter as the slide is shown. ",0]]]],[[0,[["Rationale: The same alternate method applies to this slide.",0]]],[0,[["Thank you for viewing this slide show. Learning basic guidelines for document creation is especially helpful for two reasons: 1) it frees you from simple mistakes and helps you become more persuasive and 2) if you learn the guidelines you become free to tinker with them to create new and innovative designs.",0]]]],[]],[['Font0','Arial Black',1],['Font1','Helvetica',1],['Font2','Arial Black',1],['Font3','Helvetica',1],['Font4','Helvetica',1],['Font5','Arial',1]]);